const logoMaskapai = {
    citilink: require('./logoPNG/citilink.png'),
    lion: require('./logoPNG/lion.png'),
    batik: require('./logoPNG/batik.png'),
    sriwijaya: require('./logoPNG/Sriwijaya.png'),
    airasia: require('./logoPNG/AirAsia.png')
}

export default logoMaskapai;
